import React, { useEffect, useState } from 'react'
import "./Iphone11.css"
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { InputLabel, MenuItem, Select } from '@mui/material';
import Alert from '@mui/material/Alert';
import Stack from '@mui/material/Stack';


function Iphone11() {

    const [iphone,setIphone] = useState()
    const [success,setSuccess] = useState(false)


    const [color, setColor] = useState(null)
    const [gb,setGb] = useState()


    const [cart, setCart] = useState(true)
    const handleAddCart = (e) => {
      const chooseColor = setColor(e.target.value)
      const chooseGB = setGb(e.target.value)
      setCart(`${chooseColor} ${chooseGB}`)
     console.log( setCart(`${chooseColor} ${chooseGB}`))

    }




    //    const getIphone = async ()=>{
    //     const url = "http://localhost:5000/iphone/iphone11"

    //     const response = await fetch(url);
    //     const responseJson = await response.json();

    //     setIphone(responseJson.iphone)
    // }



        // useEffect(()=>{
        //   getIphone()
        // },[])

  return (

  <div className='choose'>
   <Box sx={{ minWidth: 275 }}>
      <Card variant="outlined">
      <CardContent>

    <InputLabel id="demo-simple-select-label">  בחר צבע:</InputLabel>
    <Select value={color}

    labelId="demo-simple-select-label"
    id="demo-simple-select"
    label="בחר צבע:"

  >
    <MenuItem style={{background:"red"}} value={color}>RED(PRODUCT)</MenuItem>
    <MenuItem style={{background:"#2B333D"}} value="Midnight">Midnight</MenuItem>
    <MenuItem style={{background:"#FFFACD"}} value="Yellow">Yellow</MenuItem>
    <MenuItem style={{background:"#D8BFD8	"}} value="Purple">Purple</MenuItem>
  </Select>


    </CardContent>


    <CardContent>
      <InputLabel id="demo-simple-select-label">   בחר זיכרון:</InputLabel>
        <Select value={gb}
    labelId="demo-simple-select-label"
    id="demo-simple-select"
    label="בחר זיכרון:"
  >
    <MenuItem value={"128GB"}>128GB</MenuItem>
    <MenuItem value={"256GB"}>256GB</MenuItem>
    <MenuItem value={"512GB"}>512GB</MenuItem>
    <MenuItem value={"1TB"}>1TB</MenuItem>
  </Select>

    </CardContent>
    </Card>

    {cart ? <Stack sx={{ width: '100%' }} spacing={2}>



      <Button onClick={handleAddCart} variant="contained">להוסיף לסל</Button>
      </Stack>
    : <Alert  severity="success">Product Add to Cart!</Alert>}

    </Box>



  </div>
  )
}

export default Iphone11
